SET FOREIGN_KEY_CHECKS=0;

DROP TABLE IF EXISTS `il`;
CREATE TABLE `il` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `isim` varchar(255) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `isim` (`isim`)
) ENGINE=InnoDB AUTO_INCREMENT=82 DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `ilce`;
CREATE TABLE `ilce` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `il_id` int(11) NOT NULL DEFAULT '0',
  `isim` varchar(255) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `il_id` (`il_id`),
  KEY `isim` (`isim`),
  CONSTRAINT `ilce_ibfk_1` FOREIGN KEY (`il_id`) REFERENCES `il` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=958 DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `pkod`;
CREATE TABLE `pkod` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `kod` varchar(10) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `kod` (`kod`)
) ENGINE=InnoDB AUTO_INCREMENT=3227 DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `semt`;
CREATE TABLE `semt` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `ilce_id` int(11) NOT NULL DEFAULT '0',
  `pkod_id` int(11) NOT NULL,
  `isim` varchar(255) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `ilce_id` (`ilce_id`),
  KEY `isim` (`isim`),
  KEY `pkod_id` (`pkod_id`) USING BTREE,
  CONSTRAINT `semt_ibfk_1` FOREIGN KEY (`ilce_id`) REFERENCES `ilce` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `semt_ibfk_2` FOREIGN KEY (`pkod_id`) REFERENCES `pkod` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=52836 DEFAULT CHARSET=utf8;

